import "./Mymain.css";

function Main() {
  return (
    <div className="main-div">
      <div className="input-search-dropdown">
        <form action="" class="form">
          <input
            onsubmit="clickeve"
            class="input"
            placeholder="search"
            type="text"
          />
        </form>
      </div>
    </div>
  );
}
export default Main;
